const voting = async (setter) => {
      await new Promise(r => setTimeout(r, 2000));
      setter(1);
      await new Promise(r => setTimeout(r, 2000));
      setter(2);
      await new Promise(r => setTimeout(r, 2000));
      setter(3);
}

export default voting;
